import React from "react";

export const Header = () => {
    return (
      <div className="bg-[#bbf7d0] p-4">
        <div className="max-w-[1240px] py- text-center border flex justify-between border-black mx-auto">
          <div className="text-1xl text-[#fb7185] font-bold">
            GMTechratan Technology
          </div>
          <ul className="flex text-[#111827] gap-5">
            <li>Home</li>
            <li>Company</li>
            <li>Resource</li>
            <li>About Us</li>
            <li>Contact Us</li>
          </ul>
        </div>
      </div>
    );
};
